const ShowList = (props) => {

    return (
        <div>
            {/* iterates through each part of array */}
            {props.countries.map((subpart, i) => {
                // checks if search is included in name
               if (props.search !== '' && subpart.name.common.includes(props.search)) {
                    return (
                        <p key={subpart.name.common}>
                            {subpart.name.common}
                        </p>)
                }
            }
            )}
        </div>
    )
}

export default ShowList
